import React from 'react';
import { UAParser } from 'ua-parser-js';

const List = props => {
    const users = props.users.map(user => (
    <div key={user.name.last}>
    
        <h4>{`${user.name.tittle}${user.name.last}`}</h4>
        
        </div>
            ))
    return ( 
    
        <ul>{users}</ul>
         );
}
 
export default List;
